class CategoryDetailPage extends React.Component {
    state = {name : this.props.location.pathname}
    render() {
        console.log(this.props);
        return (
            <div>
                <Header as = "h1">{this.state.name}</Header>
                <Header as = "h4" floated = "left">Description</Header>
                <img src = {photo} alt = "image" width = "200" height = "200"/>
            </div>
        );
    }
}

export default CategoryDetailPage;
